import { Card } from 'antd';
import React from 'react';
import ContextTheme from '../context/ContextTheme';
const Cardtheme = () => {
	const { dark } = React.useContext(ContextTheme);
	console.log(dark);
	return (
		<div>
			<Card className="Card">
				<p>Hello moi nguoi</p>
			</Card>
		</div>
	);
};
export default Cardtheme;
